class MyApp extends App {
  render() {
    const { Component, pageProps } = this.props;
    return (
      <React.Fragment>
        <Head>
          <title></title>
          <meta charSet="utf-8" />
        </Head>
          <Component {...pageProps} />
      </React.Fragment>
    );
  }
}

export default MyApp;
